The '''young impling jar''' is the result of successfully catching a [[Young impling]], whilst also having an empty [[impling jar]]. Young impling jars are not that commonly looted because of the low value of the loot. Instead, the jar can be traded in singularly to [[Elnock Inquisitor]] for 3 empty impling jars. This allows the player to collect 3 more higher level implings for them to loot.

If a player catches an impling without an empty impling jar, they will automatically receive the loot instead.

You can trade two of this jar, along with three [[baby impling jar]]s and one [[Gourmet impling jar]] to Elnock for a vial of [[Imp repellent]].


==Loot==
At current [[Grand Exchange]] prices, opening a young impling jar gives {{Coins|{{ImpValue|young|jar=yes}} round 0}} worth of loot, on average. This means opening young impling jars marks an average profit of {{Coins|{{ImpValue|young|jar=yes}}-{{GEP|Young impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|50*({{ImpValue|young|jar=yes}}-{{GEP|Young impling jar}}) round 0}} to get an [[clue scroll (easy)|easy clue scroll]], and {{Coins|25*({{ImpValue|young|jar=yes}}-{{GEP|Young impling jar}}) round 0}} to get a [[clue scroll (beginner)|beginner clue scroll]] from young impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

